description:
Al Adamson, director of such classics as &quot;Dracula vs Frankenstein&quot;, &quot;Black Samurai&quot; and &quot;Brain of Blood&quot; directed this action movie starring blaxploitation star Jim Kelly. The movie also stars James Bond actors George Lazenby and Harold Oddjob Sakata as well as Terry Moore, Aldo Ray and Bob Minor.

Plot summary from IMDb:

&quot;The Pig has a plan to eradicate some people with a freeze bomb that instantly freezes people to death. It is up to Detective Ash to stop him and protect the woman with the secret to the ice bomb embedded in a microdot under the skin of her forehead.&quot;
